import React, { Component } from 'react'
import { NavLink } from 'react-router-dom'
import { Menu } from 'antd';
import { AppstoreOutlined, MailOutlined, SettingOutlined } from '@ant-design/icons';

export default class Navigation extends Component {

    render() {
        const { SubMenu } = Menu;

        // submenu keys of first level
        const rootSubmenuKeys = ['sub1', 'sub2', 'sub4'];
    
        const Sider = () => {
        const [openKeys, setOpenKeys] = React.useState(['sub1']);
    
        const onOpenChange = keys => {
        const latestOpenKey = keys.find(key => openKeys.indexOf(key) === -1);
        if (rootSubmenuKeys.indexOf(latestOpenKey) === -1) {
          setOpenKeys(keys);
        } else {
          setOpenKeys(latestOpenKey ? [latestOpenKey] : []);
        }
      };
        return (
            <div>
                <Menu mode="inline" openKeys={openKeys} onOpenChange={onOpenChange} style={{ width: 256 }}>
      <SubMenu key="sub1" icon={<MailOutlined />} title="Navigation One">
        <Menu.Item key="1">Option 1</Menu.Item>
        <Menu.Item key="2">Option 2</Menu.Item>
        <Menu.Item key="3">Option 3</Menu.Item>
        <Menu.Item key="4">Option 4</Menu.Item>
      </SubMenu>
      <SubMenu key="sub2" icon={<AppstoreOutlined />} title="Navigation Two">
        <Menu.Item key="5">Option 5</Menu.Item>
        <Menu.Item key="6">Option 6</Menu.Item>
        <SubMenu key="sub3" title="Submenu">
          <Menu.Item key="7">Option 7</Menu.Item>
          <Menu.Item key="8">Option 8</Menu.Item>
        </SubMenu>
      </SubMenu>
      <SubMenu key="sub4" icon={<SettingOutlined />} title="Navigation Three">
        <Menu.Item key="9">Option 9</Menu.Item>
        <Menu.Item key="10">Option 10</Menu.Item>
        <Menu.Item key="11">Option 11</Menu.Item>
        <Menu.Item key="12">Option 12</Menu.Item>
      </SubMenu>
    </Menu>
                <div><img src="" alt="" /></div>
                <div>
                    <div>姓名：we</div>
                    <div>学号：2018000000</div>
                </div>
                <div>失物招领</div>
                <NavLink to="/List/Add">新增失物</NavLink>
                <NavLink to="/List/Record">失物记录</NavLink>
                <div>成员管理</div>
                <NavLink to="/List/MemberList">成员列表</NavLink>
                <NavLink to="/List/Registration">注册列表</NavLink>
                <div>系统设置</div>
                <NavLink to="/List/Selfmsg">个人信息</NavLink>
                <NavLink to="/List/About">关于我们</NavLink>
                <div>退出登录</div>
            </div>
        )
    }
    }
}
